import Button from 'react-bootstrap/Button'
import Container from 'react-bootstrap/Container'

const User = (props: {name: string, popup: (type: string)=>void}) =>{

  const deleteUser = (e: any) =>{
    props.popup('delete')
  }

  return(
    <Container className='userContainer'>
    <h3>{props.name}</h3>
    <Button onClick={deleteUser} className='deleteUserButton' variant='danger'>Delete</Button>
    </Container>
  )
}

export default User
